import React, {useState} from "react";
import Note from "./Note"
import CreateNote from "./CreateNote";
import axios from "axios"
import styles from "./index.css"
import Example from "./tailwind"

function App() {
    const [notes, setNotes] = useState([])

    const apiGet = async () => {
        await axios
            .get(`http://localhost:8080/export`)
            .then((response) => {
                setNotes(response.data)
            })
    }

    apiGet()

    return (
        <div>
            <h1>Hello world</h1>
            <CreateNote />
            {notes.map((item, index) => {return <Note id={index} key={index} title={item.title} content={item.content} />})}
        </div>
    )
}

export default App;
